description:
Incredibad is an upcoming album-DVD by the comedy troupe The Lonely Island (which previously released songs under the band name Incredibad), to be released on February 10, 2009, on Universal Republic Recordsl. Many of the songs on the album debuted on Saturday Night Live as SNL Digital Shorts. The album is also available on vinyl.
Collaborators on the album include T-Pain, Norah Jones, Jack Black, E-40, Julian Casablancas of the Strokes, Sly &amp; Robbie, DJ Nu-Mark, J-Zone, and Justin Timberlake.

